import React, {Component} from 'react';
import {Nav} from "react-bootstrap";
import Navbar from "react-bootstrap/Navbar";

class nav extends Component {
    render() {

        const logoStyle = {
            color: "blue",
            cursor : "pointer"
        };
        const textStyle = {
            fontSize: "15px",
            fontWeight: "bold"
        };

        function openLink(link,event)
        {
            console.log(event.target);
            var win = window.open(link, '_blank');
            win.focus();
        };

        return (
            <div>
                <Navbar collapseOnSelect expand="lg" bg="dark" variant="blue">

                    <Navbar.Collapse  className="mt-2 ml-1 justify-content-end" id="responsive-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link href="#home" style={textStyle}>Home</Nav.Link>
                            <Nav.Link href="#projects" style={textStyle}>Projects</Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                    <Navbar.Collapse>
                        <Navbar.Brand href="#home" className="ml-4" style={{fontSize : "20px",fontWeight : "bold"}}>Alper Tunca</Navbar.Brand>
                    </Navbar.Collapse>

                    <i className="fab fa-github-square fa-2x mr-2" aria-hidden="false" style={logoStyle} onClick={openLink.bind(this,"https://github.com/alperTunca")}/>
                    <i className="fab fa-linkedin fa-2x mr-2" aria-hidden="true"style={logoStyle} onClick={openLink.bind(this,"https://www.linkedin.com/in/alper-tunca-419611173/")}/>
                    <i className="fab fa-twitter-square fa-2x mr-1" style={logoStyle} onClick={openLink.bind(this,"https://twitter.com/tuncaa34")}/>

                </Navbar>
            </div>
        );
    }
}

export default Navbar;
